<style>
    body {
        box-sizing: border-box;
        overflow: hidden;
        width: 100%;
        margin: 0;
        padding: 0;
    }
    
    .wr-container {
        max-width: 1100px;
        margin: 0 auto;
    }
    
    .op {
        -webkit-transition: opacity .5s ease;
        -moz-transition: opacity .5s ease;
        -ms-transition: opacity .5s ease;
        -o-transition: opacity .5s ease;
        transition: opacity .5s ease;
        opacity: 0.1;
        cursor: pointer;
    }
    
    .svg_path {
        position: relative;
        top: 20px;
    }
    
    .svg_path .rooms_text_one {
        color: #000;
        font-size: 50px;
        font-weight: 700;
        text-decoration: none;
        display: none;
        position: absolute;
        left: 30%;
        right: 30%;
        top: 50%;
        text-align: center;
        transition: opacity 9s ease;
        opacity: 0;
    }
    
    .link_vb {
        display: block !important;
        -webkit-transition: opacity .5s ease;
        -moz-transition: opacity .5s ease;
        -ms-transition: opacity .5s ease;
        -o-transition: opacity .5s ease;
        transition: opacity .5s ease;
        opacity: 1 !important;
    }
    
    p.rooms_text_one {
        cursor: pointer;
        pointer-events: none;
    }
    
    .footer-txt p {
        text-align: center;
        position: relative;
        bottom: 50px;
        font-size: 18px;
        color: #727272;
    }
</style>
